#!/usr/bin/env python3
import time
import threading
import sys
from math import inf

# GlobÃ¡lnÃ­ konstanty â€“ pohyby jezdce (relativnÃ­ souÅ™adnice)
knight_moves = [(2,1),(2,-1),(-2,1),(-2,-1),(1,2),(1,-2),(-1,2),(-1,-2)]

# GlobÃ¡lnÃ­ promÄ›nnÃ© pro sledovÃ¡nÃ­ Äasu
running = False
start_time = 0

###############################################################################
# Funkce pro vÃ½pis Äasu v samostatnÃ©m vlÃ¡knÄ›
###############################################################################

def time_reporter():
    """Funkce pro vÃ½pis aktuÃ¡lnÃ­ho Äasu kaÅ¾dou sekundu na stejnÃ©m Å™Ã¡dku."""
    global running, start_time
    while running:
        elapsed = time.time() - start_time
        hrs = int(elapsed // 3600)
        mins = int((elapsed % 3600) // 60)
        secs = int(elapsed % 60)
        
        # PouÅ¾ijeme \r pro nÃ¡vrat na zaÄÃ¡tek Å™Ã¡dku a pÅ™epsÃ¡nÃ­ pÅ™edchozÃ­ho vÃ½pisu
        sys.stdout.write(f"\r[INFO] UplynulÃ½ Äas: {hrs:02d}h {mins:02d}m {secs:02d}s")
        sys.stdout.flush()
        
        time.sleep(1)

###############################################################################
# TÅ™Ã­da Board â€“ reprezentuje Å¡achovnici a umÃ­ ji inicializovat z FEN Å™etÄ›zce.
###############################################################################

class Board:
    def __init__(self, fen=None):
        """Inicializace Å¡achovnice; pokud je zadÃ¡n FEN, nastavÃ­ pozici podle nÄ›j."""
        self.grid = [[' ' for _ in range(8)] for _ in range(8)]
        self.to_move = 'w'
        self.castling_rights = set()  # napÅ™. {'K','Q','k','q'}
        self.en_passant = None       # (row, col) nebo None
        self.halfmove_clock = 0
        self.fullmove_number = 1
        if fen:
            self.set_fen(fen)
    
    def set_fen(self, fen):
        """NastavÃ­ Å¡achovnici podle FEN Å™etÄ›zce."""
        parts = fen.split()
        while len(parts) < 6:
            parts.append('0')
        board_part, turn_part = parts[0], parts[1]
        castling_part = parts[2] if len(parts) > 2 else '-'
        en_passant_part = parts[3] if len(parts) > 3 else '-'
        halfmove = parts[4] if len(parts) > 4 else '0'
        fullmove = parts[5] if len(parts) > 5 else '1'
        self.grid = [['.' for _ in range(8)] for _ in range(8)]
        ranks = board_part.split('/')
        # FEN Å™ady zaÄÃ­najÃ­ od hornÃ­ (8.) a jdou dolÅ¯
        for rank_idx, rank_str in enumerate(ranks):
            file_idx = 0
            for ch in rank_str:
                if ch.isdigit():
                    file_idx += int(ch)
                else:
                    self.grid[rank_idx][file_idx] = ch
                    file_idx += 1
        self.to_move = 'w' if turn_part == 'w' else 'b'
        self.castling_rights = set() if castling_part == '-' else set(castling_part)
        self.en_passant = None
        if en_passant_part != '-' and en_passant_part != '':
            file = ord(en_passant_part[0]) - ord('a')
            rank = int(en_passant_part[1])
            ri = 8 - rank
            fi = file
            if 0 <= ri < 8 and 0 <= fi < 8:
                self.en_passant = (ri, fi)
        try:
            self.halfmove_clock = int(halfmove)
        except:
            self.halfmove_clock = 0
        try:
            self.fullmove_number = int(fullmove)
        except:
            self.fullmove_number = 1
    
    def copy(self):
        """VytvoÅ™Ã­ hlubokou kopii Å¡achovnice."""
        new_board = Board()
        new_board.grid = [row.copy() for row in self.grid]
        new_board.to_move = self.to_move
        new_board.castling_rights = set(self.castling_rights)
        new_board.en_passant = None if self.en_passant is None else (self.en_passant[0], self.en_passant[1])
        new_board.halfmove_clock = self.halfmove_clock
        new_board.fullmove_number = self.fullmove_number
        return new_board

    def display(self):
        """VrÃ¡tÃ­ textovou reprezentaci Å¡achovnice."""
        lines = []
        for ri in range(8):
            line = ""
            for fi in range(8):
                line += self.grid[ri][fi] + " "
            lines.append(line)
        return "\n".join(lines)

###############################################################################
# Funkce pro detekci Å¡achu, generovÃ¡nÃ­ tahÅ¯ a jejich provÃ¡dÄ›nÃ­
###############################################################################

def find_king(board, side):
    """Najde pozici krÃ¡le pro stranu 'w' nebo 'b'."""
    target = 'K' if side=='w' else 'k'
    for r in range(8):
        for c in range(8):
            if board.grid[r][c] == target:
                return (r, c)
    return None

def is_square_attacked(board, r, c, by_side):
    """ZjistÃ­, zda je pole (r,c) napadeno stranou by_side."""
    # Ãštoky pÄ›Å¡cem
    if by_side == 'b':
        if r+1 < 8 and c-1 >= 0 and board.grid[r+1][c-1] == 'p': return True
        if r+1 < 8 and c+1 < 8 and board.grid[r+1][c+1] == 'p': return True
    else:
        if r-1 >= 0 and c-1 >= 0 and board.grid[r-1][c-1] == 'P': return True
        if r-1 >= 0 and c+1 < 8 and board.grid[r-1][c+1] == 'P': return True
    
    # Ãštoky jezdcem a dalÅ¡Ã­mi s jezdcovÃ½m pohybem (N, A, C, E)
    enemy_knights = ['n','a','c','e'] if by_side=='b' else ['N','A','C','E']
    for dr, dc in knight_moves:
        nr, nc = r+dr, c+dc
        if 0<=nr<8 and 0<=nc<8 and board.grid[nr][nc] in enemy_knights:
            return True
    
    # Ãštoky po Å™adÃ¡ch/sloupcÃ­ch (R, Q, E, A)
    enemy_rook_like = ['r','q','e','a'] if by_side=='b' else ['R','Q','E','A']
    for dr, dc in [(1,0),(-1,0),(0,1),(0,-1)]:
        nr, nc = r+dr, c+dc
        while 0<=nr<8 and 0<=nc<8:
            if board.grid[nr][nc] != '.':
                if board.grid[nr][nc] in enemy_rook_like:
                    return True
                break
            nr += dr; nc += dc
    
    # Ãštoky diagonÃ¡lnÄ› (B, Q, C, A)
    enemy_bishop_like = ['b','q','c','a'] if by_side=='b' else ['B','Q','C','A']
    for dr, dc in [(1,1),(1,-1),(-1,1),(-1,-1)]:
        nr, nc = r+dr, c+dc
        while 0<=nr<8 and 0<=nc<8:
            if board.grid[nr][nc] != '.':
                if board.grid[nr][nc] in enemy_bishop_like:
                    return True
                break
            nr += dr; nc += dc
    
    # SousednÃ­ krÃ¡l
    enemy_king = 'k' if by_side=='b' else 'K'
    for dr in [-1,0,1]:
        for dc in [-1,0,1]:
            if dr==0 and dc==0: continue
            nr, nc = r+dr, c+dc
            if 0<=nr<8 and 0<=nc<8 and board.grid[nr][nc] == enemy_king:
                return True
    
    return False

def is_in_check(board, side):
    """ZjistÃ­, zda je krÃ¡l strany side ('w' nebo 'b') v Å¡achu."""
    king_pos = find_king(board, side)
    if not king_pos:
        return False
    kr, kc = king_pos
    enemy_side = 'b' if side=='w' else 'w'
    return is_square_attacked(board, kr, kc, enemy_side)

def generate_pseudo_moves(board, side):
    """Generuje vÅ¡echny pseudolegÃ¡lnÃ­ tahy pro stranu side ('w' nebo 'b')."""
    moves = []
    enemy = 'b' if side=='w' else 'w'
    is_white = (side=='w')
    pawn_dir = -1 if is_white else 1
    start_rank = 6 if is_white else 1
    promote_rank = 0 if is_white else 7
    for r in range(8):
        for c in range(8):
            piece = board.grid[r][c]
            if piece == '.': continue
            if is_white and not piece.isupper(): continue
            if not is_white and not piece.islower(): continue
            pt = piece.upper()
            if pt == 'P':
                nr = r + pawn_dir
                if 0<=nr<8 and board.grid[nr][c]=='.':
                    if nr==promote_rank:
                        for promo in ['Q','R','B','N','A','E','C']:
                            moves.append((r, c, nr, c, promo if is_white else promo.lower(), None))
                    else:
                        moves.append((r, c, nr, c, None, None))
                    if r==start_rank and board.grid[r+pawn_dir*2][c]=='.' and board.grid[r+pawn_dir][c]=='.':
                        moves.append((r, c, r+pawn_dir*2, c, None, 'double'))
                for dc in [-1,1]:
                    nc = c + dc
                    if 0<=nc<8 and 0<=nr<8:
                        if board.grid[nr][nc] != '.' and ((is_white and board.grid[nr][nc].islower()) or (not is_white and board.grid[nr][nc].isupper())):
                            if nr==promote_rank:
                                for promo in ['Q','R','B','N','A','E','C']:
                                    moves.append((r, c, nr, nc, promo if is_white else promo.lower(), None))
                            else:
                                moves.append((r, c, nr, nc, None, None))
                        if board.en_passant == (nr, nc):
                            moves.append((r, c, nr, nc, None, 'enpassant'))
            elif pt == 'K':
                for dr in [-1,0,1]:
                    for dc in [-1,0,1]:
                        if dr==0 and dc==0: continue
                        nr, nc = r+dr, c+dc
                        if 0<=nr<8 and 0<=nc<8:
                            if board.grid[nr][nc]=='.' or ((is_white and board.grid[nr][nc].islower()) or (not is_white and board.grid[nr][nc].isupper())):
                                moves.append((r, c, nr, nc, None, None))
                # RoÅ¡Ã¡dy (zÃ¡kladnÃ­ verze)
                if is_white and r==7 and c==4:
                    if 'K' in board.castling_rights and board.grid[7][5]=='.' and board.grid[7][6]=='.':
                        moves.append((7,4,7,6,None,'castle'))
                    if 'Q' in board.castling_rights and board.grid[7][3]=='.' and board.grid[7][2]=='.' and board.grid[7][1]=='.':
                        moves.append((7,4,7,2,None,'castle'))
                if not is_white and r==0 and c==4:
                    if 'k' in board.castling_rights and board.grid[0][5]=='.' and board.grid[0][6]=='.':
                        moves.append((0,4,0,6,None,'castle'))
                    if 'q' in board.castling_rights and board.grid[0][3]=='.' and board.grid[0][2]=='.' and board.grid[0][1]=='.':
                        moves.append((0,4,0,2,None,'castle'))
            else:
                # Tahy pro figury s jezdcovÃ½m pohybem (N, A, C, E)
                if pt in ['N','A','C','E']:
                    for dr, dc in knight_moves:
                        nr, nc = r+dr, c+dc
                        if 0<=nr<8 and 0<=nc<8:
                            if board.grid[nr][nc]=='.' or ((is_white and board.grid[nr][nc].islower()) or (not is_white and board.grid[nr][nc].isupper())):
                                moves.append((r, c, nr, nc, None, None))
                # KlouzavÃ© tahy â€“ pro R, Q, E, A
                if pt in ['R','Q','E','A']:
                    for dr, dc in [(1,0),(-1,0),(0,1),(0,-1)]:
                        nr, nc = r+dr, c+dc
                        while 0<=nr<8 and 0<=nc<8:
                            if board.grid[nr][nc]=='.':
                                moves.append((r, c, nr, nc, None, None))
                            else:
                                if ((is_white and board.grid[nr][nc].islower()) or (not is_white and board.grid[nr][nc].isupper())):
                                    moves.append((r, c, nr, nc, None, None))
                                break
                            nr += dr; nc += dc
                if pt in ['B','Q','C','A']:
                    for dr, dc in [(1,1),(1,-1),(-1,1),(-1,-1)]:
                        nr, nc = r+dr, c+dc
                        while 0<=nr<8 and 0<=nc<8:
                            if board.grid[nr][nc]=='.':
                                moves.append((r, c, nr, nc, None, None))
                            else:
                                if ((is_white and board.grid[nr][nc].islower()) or (not is_white and board.grid[nr][nc].isupper())):
                                    moves.append((r, c, nr, nc, None, None))
                                break
                            nr += dr; nc += dc
    return moves

def get_legal_moves(board, side):
    """VrÃ¡tÃ­ seznam legÃ¡lnÃ­ch tahÅ¯ pro danou stranu."""
    moves = generate_pseudo_moves(board, side)
    legal_moves = []
    for move in moves:
        make_move(move, board)
        if not is_in_check(board, side):
            legal_moves.append(move)
        undo_move(board)
    return legal_moves

# ZÃ¡sobnÃ­k pro tahy (pro undo)
move_stack = []

def make_move(move, board):
    """Provede tah na Å¡achovnici a uloÅ¾Ã­ stav pro moÅ¾nost undo.
       move: (r1, c1, r2, c2, promo, special)"""
    r1, c1, r2, c2, promo, special = move
    piece = board.grid[r1][c1]
    captured = board.grid[r2][c2] if special != 'enpassant' else ('p' if piece=='P' else 'P')
    prev_state = (set(board.castling_rights), board.en_passant)
    move_stack.append((r1, c1, r2, c2, promo, special, piece, captured, prev_state))
    board.grid[r1][c1] = '.'
    if special == 'castle':
        board.grid[r2][c2] = piece
        if piece == 'K':
            if c2 == 6:
                board.grid[7][5] = 'R'; board.grid[7][7] = '.'
            else:
                board.grid[7][3] = 'R'; board.grid[7][0] = '.'
        else:
            if c2 == 6:
                board.grid[0][5] = 'r'; board.grid[0][7] = '.'
            else:
                board.grid[0][3] = 'r'; board.grid[0][0] = '.'
    elif special == 'enpassant':
        board.grid[r2][c2] = piece
        if piece == 'P':
            board.grid[r2+1][c2] = '.'
        else:
            board.grid[r2-1][c2] = '.'
    else:
        board.grid[r2][c2] = promo if promo else piece
    if piece == 'K':
        board.castling_rights.discard('K'); board.castling_rights.discard('Q')
    if piece == 'k':
        board.castling_rights.discard('k'); board.castling_rights.discard('q')
    if piece == 'R' and (r1, c1)==(7,7):
        board.castling_rights.discard('K')
    if piece == 'R' and (r1, c1)==(7,0):
        board.castling_rights.discard('Q')
    if piece == 'r' and (r1, c1)==(0,7):
        board.castling_rights.discard('k')
    if piece == 'r' and (r1, c1)==(0,0):
        board.castling_rights.discard('q')
    if special == 'double':
        board.en_passant = (r1 + (-1 if board.to_move=='w' else 1), c1)
    else:
        board.en_passant = None
    board.to_move = 'b' if board.to_move=='w' else 'w'

def undo_move(board):
    """VrÃ¡tÃ­ poslednÃ­ provedenÃ½ tah."""
    r1, c1, r2, c2, promo, special, piece, captured, prev_state = move_stack.pop()
    board.grid[r1][c1] = piece
    if special == 'castle':
        board.grid[r2][c2] = '.'
        if piece == 'K':
            if c2 == 6:
                board.grid[7][7] = 'R'; board.grid[7][5] = '.'
            else:
                board.grid[7][0] = 'R'; board.grid[7][3] = '.'
        else:
            if c2 == 6:
                board.grid[0][7] = 'r'; board.grid[0][5] = '.'
            else:
                board.grid[0][0] = 'r'; board.grid[0][3] = '.'
    elif special == 'enpassant':
        board.grid[r2][c2] = '.'
        if piece == 'P':
            board.grid[r2+1][c2] = 'p'
        else:
            board.grid[r2-1][c2] = 'P'
    else:
        board.grid[r2][c2] = captured
    board.castling_rights, board.en_passant = prev_state
    board.to_move = 'b' if board.to_move=='w' else 'w'

###############################################################################
# JednoduchÃ¡ funkce pro zjiÅ¡tÄ›nÃ­, zda je mat v urÄitÃ© hloubce 
# (pro pomoc s detekcÃ­ matÅ¯ za urÄitÃ½ poÄet tahÅ¯)
###############################################################################

def is_mate_in_n(board, side, depth):
    """Zkontroluje, zda je pozice mat (pro stranu side) v zadanÃ© hloubce."""
    if depth == 0:
        # Kontrola matu
        legal_moves = get_legal_moves(board, side)
        return not legal_moves and is_in_check(board, side)
    
    # RekurzivnÃ­ kontrola pro stranu side (zda mÃ¡ vynucenÃ½ mat)
    legal_moves = get_legal_moves(board, side)
    
    if not legal_moves:
        return False  # NemÃ¡me tahy, nemÅ¯Å¾eme dÃ¡t mat
    
    # Zkontrolujeme vÅ¡echny tahy, musÃ­ existovat alespoÅˆ jeden, kterÃ½ vede k matu
    opponent = 'b' if side=='w' else 'w'
    for move in legal_moves:
        make_move(move, board)
        # Pro vÅ¡echny odpovÄ›di protivnÃ­ka musÃ­ bÃ½t mat
        opponent_can_avoid_mate = False
        opponent_legal_moves = get_legal_moves(board, opponent)
        
        if not opponent_legal_moves:
            # ProtivnÃ­k nemÃ¡ tahy - buÄ je to mat nebo pat
            if is_in_check(board, opponent):
                undo_move(board)
                return True  # JiÅ¾ nynÃ­ mÃ¡me mat
            # Jinak je to pat a to nenÃ­ vÃ½hra
        
        # Pokud mÃ¡ protivnÃ­k tahy, musÃ­me provÄ›Å™it vÅ¡echny
        for op_move in opponent_legal_moves:
            make_move(op_move, board)
            if not is_mate_in_n(board, side, depth-1):
                opponent_can_avoid_mate = True
            undo_move(board)
            if opponent_can_avoid_mate:
                break
        
        undo_move(board)
        
        # Pokud protivnÃ­k nemÅ¯Å¾e vyhnout matu, mÃ¡me mat za 'depth' tahÅ¯
        if not opponent_can_avoid_mate:
            return True
    
    return False

###############################################################################
# Negamax s alfa-beta oÅ™ezÃ¡vÃ¡nÃ­m pro hledÃ¡nÃ­ nejlepÅ¡Ã­ sekvence
###############################################################################

def negamax(board, depth, alpha, beta, side):
    """Negamax s alfa-beta oÅ™ezÃ¡vÃ¡nÃ­m.
       side: 1 pro bÃ­lÃ©ho, -1 pro ÄernÃ©ho.
       VracÃ­ (hodnota, tahovÃ¡ sekvence)."""
    # KoncovÃ© podmÃ­nky - mat (nebo pat kdyÅ¾ depth=0)
    curr_color = 'w' if side == 1 else 'b'
    legal_moves = get_legal_moves(board, curr_color)
    
    # Kontrola na mat nebo pat (terminÃ¡lnÃ­ stavy)
    if not legal_moves:
        if is_in_check(board, curr_color):
            return -inf, []  # Mat
        return 0, []  # Pat
    
    # DosÃ¡hli jsme maximÃ¡lnÃ­ hloubky - zÃ¡kladnÃ­ ohodnocenÃ­
    if depth == 0:
        # Kontrola, zda mÃ¡me mat v nejbliÅ¾Å¡Ã­ch tazÃ­ch
        enemy_color = 'b' if curr_color == 'w' else 'w'
        for move in legal_moves:
            make_move(move, board)
            enemy_legal_moves = get_legal_moves(board, enemy_color)
                
            if not enemy_legal_moves and is_in_check(board, enemy_color):
                undo_move(board)
                return inf, [move]  # NaÅ¡li jsme mat
            undo_move(board)
        
        # Pro jednoduchost zde neohodnocujeme materiÃ¡l, pozici atd.
        # V reÃ¡lnÃ©m Å¡achovÃ©m enginu bychom zde vraceli pozici na zÃ¡kladÄ› materiÃ¡lu, struktury pÄ›Å¡cÅ¯ atd.
        return 0, []
    
    best_val = -inf
    best_line = []
    
    # SeÅ™azenÃ­ tahÅ¯ pro alfa-beta
    legal_moves.sort(key=lambda m: 1 if board.grid[m[2]][m[3]] != '.' else 0, reverse=True)
    
    for move in legal_moves:
        make_move(move, board)
        val, line = negamax(board, depth-1, -beta, -alpha, -side)
        val = -val
        undo_move(board)
        
        if val > best_val:
            best_val = val
            best_line = [move] + line
        
        alpha = max(alpha, best_val)
        if alpha >= beta:
            break
    
    return best_val, best_line

###############################################################################
# IterativnÃ­ prohlubovÃ¡nÃ­ â€“ hledÃ¡me do maximÃ¡lnÃ­ hloubky a vypisujeme uplynulÃ½ Äas
###############################################################################

def iterative_deepening(board, max_depth=50, time_limit=300):
    """IterativnÃ­ prohlubovÃ¡nÃ­ s ÄasovÃ½m limitem (vÃ½chozÃ­ 5 minut)."""
    global running, start_time
    
    # SpuÅ¡tÄ›nÃ­ ÄasovacÃ­ho vlÃ¡kna
    running = True
    start_time = time.time()
    timer_thread = threading.Thread(target=time_reporter)
    timer_thread.daemon = True
    timer_thread.start()
    
    best_line = []
    best_val = 0
    
    try:
        # NejdÅ™Ã­ve zkontrolujeme, zda mÃ¡me vÅ¯bec nÄ›jakÃ© legÃ¡lnÃ­ tahy
        curr_side = board.to_move
        enemy_side = 'b' if curr_side=='w' else 'w'
        
        legal_moves = get_legal_moves(board, curr_side)
        
        # Pokud nemÃ¡me Å¾Ã¡dnÃ© legÃ¡lnÃ­ tahy, je to pat nebo mat
        if not legal_moves:
            total_elapsed = time.time() - start_time
            running = False
            if is_in_check(board, curr_side):
                return -inf, [], total_elapsed  # Mat
            return 0, [], total_elapsed  # Pat
        
        # Zkontrolujeme, zda mÃ¡me mat v jednom tahu
        for move in legal_moves:
            make_move(move, board)
            enemy_legal = get_legal_moves(board, enemy_side)
            
            if not enemy_legal and is_in_check(board, enemy_side):
                # NaÅ¡li jsme mat v jednom tahu
                undo_move(board)
                running = False
                return inf, [move], 0.1
            undo_move(board)
        
        # Pokud mÃ¡me jen jeden legÃ¡lnÃ­ tah, vrÃ¡tÃ­me ho bez dalÅ¡Ã­ho poÄÃ­tÃ¡nÃ­
        if len(legal_moves) == 1:
            running = False
            return 0, legal_moves, 0.1
        
        # NynÃ­ zaÄnÄ›me iterativnÃ­ prohlubovÃ¡nÃ­
        for depth in range(1, max_depth+1):
            t0 = time.time()
            val, line = negamax(board, depth, -inf, inf, 1 if board.to_move=='w' else -1)
            t1 = time.time()
            elapsed = time.time() - start_time
            
            # VÃ½pis Äasu po dosaÅ¾enÃ­ kaÅ¾dÃ© hloubky
            hrs = int(elapsed // 3600)
            mins = int((elapsed % 3600) // 60)
            secs = int(elapsed % 60)
            
            # Po vÃ½pisu kaÅ¾dÃ© hloubky pÅ™ejdeme na novÃ½ Å™Ã¡dek
            move_time = t1 - t0
            sys.stdout.write("\n")  # NovÃ½ Å™Ã¡dek po ÄasovÃ©m informaÄnÃ­m Å™Ã¡dku
            print(f"Hloubka {depth:2d} â€“ uplynulÃ½ Äas: {hrs:02d}h {mins:02d}m {secs:02d}s (poslednÃ­ krok: {move_time:.2f}s)")
            
            # Aktualizujeme nejlepÅ¡Ã­ nalezenou sekvenci
            best_val = val
            best_line = line
            
            # Pokud jsme naÅ¡li vynucenÃ½ mat nebo pat, konÄÃ­me
            if abs(val) == inf or time.time() - start_time > time_limit:
                if time.time() - start_time > time_limit:
                    print(f"ÄŒasovÃ½ limit vyprÅ¡el po {time_limit} sekundÃ¡ch")
                break
        
        # OvÄ›Å™enÃ­, Å¾e kdyÅ¾ mÃ¡me tahy, tak vrÃ¡tÃ­me nejlepÅ¡Ã­ z nich (i kdyÅ¾ je remÃ­za)
        if not best_line and legal_moves:
            best_line = [legal_moves[0]]
                
        total_elapsed = time.time() - start_time
        return best_val, best_line, total_elapsed
    
    finally:
        # ZajistÃ­me ukonÄenÃ­ ÄasovacÃ­ho vlÃ¡kna
        running = False
        timer_thread.join(timeout=1.0)
        # PÅ™ejdeme na novÃ½ Å™Ã¡dek po poslednÃ­m ÄasovÃ©m vÃ½pisu
        sys.stdout.write("\n")
        sys.stdout.flush()

