def move_to_notation(move):
    cols = "abcdefgh"
    r1, c1, r2, c2, promo, special = move
    if special == 'castle':
        return "O-O" if c2 > c1 else "O-O-O"
    s = cols[c1] + str(8 - r1) + cols[c2] + str(8 - r2)
    if promo:
        s += "=" + promo.upper()
    if special == 'enpassant':
        s += " e.p."
    return s

