def analyze_position(board):
    """Analyzuje pozici a vracÃ­ vÃ½sledek."""
    # ZjistÃ­me stranu na tahu
    side_to_move = board.to_move
    
    # ZjistÃ­me, zda mÃ¡ strana na tahu legÃ¡lnÃ­ tahy
    legal_moves = get_legal_moves(board, side_to_move)
    
    # Kontrola na mat nebo pat
    if not legal_moves:
        if is_in_check(board, side_to_move):
            if side_to_move == 'w':
                return "Mat â€“ ÄernÃ½ vyhrÃ¡vÃ¡"
            else:
                return "Mat â€“ bÃ­lÃ½ vyhrÃ¡vÃ¡"
        else:
            return "Pat (remÃ­za)"
    
    # ZjistÃ­me, zda po provedenÃ­ tahu bude mat
    for move in legal_moves:
        make_move(move, board)
        opponent = 'b' if side_to_move == 'w' else 'w'
        opponent_legal_moves = get_legal_moves(board, opponent)
        
        if not opponent_legal_moves and is_in_check(board, opponent):
            undo_move(board)
            if side_to_move == 'w':
                return "Mat v pÅ™Ã­Å¡tÃ­m tahu â€“ bÃ­lÃ½ vyhrÃ¡vÃ¡"
            else:
                return "Mat v pÅ™Ã­Å¡tÃ­m tahu â€“ ÄernÃ½ vyhrÃ¡vÃ¡"
        undo_move(board)
    
    # Pokud nemÃ¡me ani mat ani pat, pozice je otevÅ™enÃ¡
